import React from "react";
import notes from "../notes";

function createNote(props) {
  return (
    <div>
      <h1>{props.title}</h1>
      <p>{props.content}</p>
    </div>
  );
}

function Note() {
  return (
    <div className="note">
      <createNote title="new title" content={notes[0].content} />
    </div>
  );
}

export default Note;
